import React from "react";
import styled from "styled-components";
import PropTypes from "prop-types";
import { Col, Row } from "antd";

const BlocStyled = styled.div`
  position: absolute;
  top: 30px;
  left: -400px;
  background-color: white;
  width: 500px;
  height: 200px;
  font-size: 25px;
  border-radius: 5px;
`;

const DashBoard = ({
  remainingPoints,
  selectedSkills,
  level,
  simuationInProgress,
}) => {
  return (
    <BlocStyled>
      <Row>
        <Col>{`Niv. ${level}`}</Col>
        <Col>{`Points restantes ${remainingPoints}`}</Col>
        <Col>
          <ul>
            {selectedSkills.map((item) => (
              <li>{item.text}</li>
            ))}
          </ul>
        </Col>
      </Row>
    </BlocStyled>
  );
};

DashBoard.propTypes = {
  remainingPoints: PropTypes.number,
  selectedSkills: PropTypes.array,
  level: PropTypes.number,
  simuationInProgress: PropTypes.bool,
};

export default DashBoard;
